import React from 'react'
import companyLogo from '../../assets/logo-search-grid-1x.png'
export default function logo() {
  return (
        <><style>
          .logo{
            {height:200,
            width:300
          }}
      </style><img className="logo" src={companyLogo} alt="BigCo Inc. logo" /></>
  )
}
